using Microsoft.AspNetCore.Http;
using Wookiee.Service.Model.Book;
using Wookiee.Utility.Response;
using Wookiee.WebAppApi.PostData.Book;

namespace Wookiee.WebAppApi.Test.Model.Book;

public static class Mapper
{
    public static Create ToCreate()
    {
        return new Create
        {
            Description = "Test description",
            Price = 50.50M,
            Title = "Test title",
            Image = null,
        };
    }

    public static Update ToUpdate()
    {
        return new Update
        {
            Description = "Test description",
            Price = 50.50M,
            Title = "Test title",
            Id = 1,
            Image = null,
        };
    }

    public static ResponseObject<BookInfoDto> ToResponseObject()
    {
        return new ResponseObject<BookInfoDto>
        {
            Exception = null,
            ErrorMessage = null,
            IsSuccess = true,
            Result = new BookInfoDto
            {
                Description = "Test description",
                Price = 50.50M,
                // Image = string.Empty,
                AuthorName = "Test author",
                BookId = 1,
                Title = "Test title",
            }
        };
    }

    public static ResponseObject<List<BookInfoDto>> ToListResponseObject()
    {
        return new ResponseObject<List<BookInfoDto>>
        {
            Exception = null,
            ErrorMessage = null,
            IsSuccess = true,
            Result = new List<BookInfoDto>
            {
                new BookInfoDto
                {
                    Description = "Test description",
                    Price = 50.50M,
                    // Image = string.Empty,
                    AuthorName = "Test author",
                    BookId = 1,
                    Title = "Test title",
                }
            }
        };
    }

    public static Create ToInvalidUploadFile()
    {
        return new Create
        {
            Description = "test",
            Price = 100.50M,
            Image = InvalidImageExtension(),
            Title = "title",
        };
    }

    public static Create ToInvalidFileLimit()
    {
        return new Create
        {
            Description = "test",
            Image = InvalidImageLimit(),
            Price = 100.00M,
            Title = "title"
        };
    }

    public static IFormFile InvalidImageExtension()
    {
        var content = "Hello World from a Fake File ";
        var fileName = "test.pdf";
        var stream = new MemoryStream();
        var writer = new StreamWriter(stream);
        writer.Write(content);
        writer.Flush();
        stream.Position = 0;
        return new FormFile(stream, 0, stream.Length, "id_from_form", fileName);
    }

    public static IFormFile InvalidImageLimit()
    {
        var content =
            "";
        var fileName = "test.jpg";
        var stream = new MemoryStream();
        var writer = new StreamWriter(stream);
        writer.Write(content);
        writer.Flush();
        stream.Position = 0;
        return new FormFile(stream, 0, stream.Length, "id_from_form", fileName);

    }
}